import { Navbar, NavbarBrand, Nav, Badge } from "react-bootstrap";

const NavBar = () => {
  return (
    <Navbar bg="light" expand="lg">
      <NavbarBrand>Blog-App</NavbarBrand>
      <Navbar.Collapse id="navbar">
        <Nav className="mx-lg-5 w-75 border">
          <Nav.Link>Tech</Nav.Link>
          <Nav.Link>Design</Nav.Link>
          <Nav.Link>Culture</Nav.Link>
          <Nav.Link>Commerce</Nav.Link>
          <Nav.Link>Stock Exchange</Nav.Link>
        </Nav>
      </Navbar.Collapse>
      <Badge variant="primary" className="py-2">
        Submit a blog
      </Badge>
      <span>AT</span>
      <Navbar.Toggle aria-controls="navbar" />
    </Navbar>
  );
};

export default NavBar;
